column13:
Асфальтно-бетоноване покиття влаштоване на більшій частині майданчика. На тереторії майданчика знаходяться:
- будівлі та споруди колишньої станції технічного обслуговування автомобілів;
- напівзруйнована будівля на ділянці майданчика, прилеглій до вул. Полупанова.;
- будівля теплообмінного пункту, яка розташована у центральній частині майданчика;
- будівля трансформаторної електричної підстанції.

Частина 1-верхової з/б  мехмайстерні (приміщення 6-17) з електропост. S=638,9;  частина 1-верхового з/б мат. складу з ел./пост  S=507,0; 1-верховий з/б  матеріальний склад з ел./пост.  S=361,7;  1-поверховий цегляний склад з еклтропост. S=89,5; металевий навіс S=7,7;  1-верховий цегляний  склад з 2-поверховою шлакоблочною диспетчерською з електропост. S= 272,3, ганком кр-2 S=11,6, мет. сходами S=6,4; 1-поверховий з/б  цех стикозварювання  S=108,3; 1-поверховий туалет S=3,5; склад ПММ S=159,6 з з/б огорожею №13 - 37,3п.м.;                                                                     Частина бетонного замощення S=19670,3; з/б лоток  L=214,0п.м.; рельси козлового крану, L=503,0п.м.; 
огорожа із металевої сітки №14,16,17 L=63,0п.м.;
металеві ворота  №15- L=18,0п.м.; з/б стовпи - 4 шт.;
оглядові  колодязї - 9 шт.;  підпірна бет. стінка, L=67,8 п.м.; бет. огорожа №22,23 L=10,2п.м.; мет. хвіртка- 1,4п.м.
